import React from 'react'
import {View, Image, TouchableHighlight, StyleSheet} from 'react-native'
import add_note from './../assets/add_note.png'

export default function SavedNote(){
    return(
        <View style={styles.mainContainer}>
            <TouchableHighlight underlayColor="#0070bb"  style={styles.addnotebutton} onPress={ () => console.log('niggi')}>
                <Image source={add_note} style={styles.thumbnail}  />                       
            </TouchableHighlight>
        </View>
    )
}

const styles = StyleSheet.create({
    mainContainer:{
        backgroundColor:'transparent',
        marginRight:5,
        marginBottom:5,
    },
    addnotebutton:{
        // justifyContent:'flex-end',
        height:60,
        width:60,
        borderRadius:30
    },
    thumbnail:{
        width:60,
        height:60
    },
})
